function mc_symbol_clone() {
	var clone = this._cloneProps(new this.constructor(this.mode, this.startPosition, this.loop));
	clone.gotoAndStop(this.currentFrame);
	clone.paused = this.paused;
	clone.framerate = this.framerate;
	return clone;
}

function getMCSymbolPrototype(symbol, nominalBounds, frameBounds) {
	var prototype = cjs.extend(symbol, cjs.MovieClip);
	prototype.clone = mc_symbol_clone;
	prototype.nominalBounds = nominalBounds;
	prototype.frameBounds = frameBounds;
	return prototype;
	}

(lib.number = function(mode,startPosition,loop) {
	this.initialize(mode,startPosition,loop,{});

	// timeline functions:
	this.frame_0 = function() {
		var numMc = this;
		var digits = [];
		var dx = 2.25;
		var pool = [];
		var align='left';
		var value;
		
		function setNumber(num) {
			num = parseInt(num);
			value = num;
			numMc.removeAllChildren();
			var x = 0;
			var len = num.toString().length;
			for (var a=Math.pow(10, len), b=a/10, i=0; i < len; i++, a /= 10, b /= 10) {
				var id = parseInt(num % a / b);
				if (!pool[i*10+id]) pool[i*10+id] = new lib['n'+id]()
				var digit = pool[i*10+id];
				digit.x = x;		
				x += digit.getBounds().width + dx - 4;		
				numMc.addChild(digit);
			}
			
			var width = numMc.getBounds().width;
			if (align == 'right') {
				for (var i=0; i < numMc.numChildren; i++) {
					numMc.children[i].x -= width;
				}		
			}	
		}
		
		Object.defineProperty(this, 'align', {
			get: () => {return align},
			set: (value) => {align = value}
		});
		
		Object.defineProperty(this, 'value', {
			get: () => {return value},
			set: setNumber
		});
		
		//this.set = setNumber;
	}

	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(1));

(lib.Train = function(mode,startPosition,loop) {
	this.initialize(mode,startPosition,loop,{});

	// timeline functions:
	this.frame_0 = function() {
		this.visible = false;
	}
	this.frame_1 = function() {
		this.stop();
		var self = this;
		var dx = 0;
		var oldX = this.x;
		this.visible = true;
		this.wheels.gotoAndStop(0);
		
		var eggs = [this.wagon1.children[1], this.wagon2.children[1], this.wagon3.children[1]];
		
		function showEggs(num) {
			for (var i=0; i < num; i++) {
				eggs[i].visible = true;
			}
		}
		
		function hideEggs() {
			for (var b of eggs) {		
				b.visible = false;		
			}
		}
		
		this.addEventListener('tick', update);
		function update() {
			dx += Math.abs(oldX - self.x);
			if (dx > 2) {
				dx = 0;
				var toFrame = self.wheels.currentFrame + 1;
				if (toFrame >= self.wheels.totalFrames) toFrame -= self.wheels.totalFrames;
				self.wheels.gotoAndStop(toFrame);
			}	
			oldX = self.x;
		}
		
		hideEggs();
		
		this.showEggs = showEggs;
		this.hideEggs = hideEggs;
	}

	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(1).call(this.frame_1).wait(1));

	// wheels
	this.wheels = new lib.Trainwheelsanim();

(lib.Farmer = function(mode,startPosition,loop) {

		var self = this;
		this.walk_front.visible = false;
		this.walk_back.visible = false;
		
		var eggs = [this.walk_front.children[1], this.walk_back.children[1], this.idle.children[1]];
		
		function showEggs() {
			for (var b of eggs) {
				b.visible = true;
			}
		}
		
		function hideEggs() {
			for (var b of eggs) {		
				b.visible = false;		
			}
		}
		
		function setState(state) {
			if (state == 'idle') {
				self.idle.visible = true;
				self.walk_front.visible = false;
				self.walk_back.visible = false;
			}
			if (state == 'walk_front_right') {
				self.idle.visible = false;
				self.walk_front.visible = true;
				self.walk_back.visible = false;
				self.walk_front.scaleX = 1;		
			}
			if (state == 'walk_back_right') {
				self.idle.visible = false;
				self.walk_front.visible = false;
				self.walk_back.visible = true;		
				self.walk_back.scaleX = 1;
			}
			if (state == 'walk_front_left') {
				self.idle.visible = false;
				self.walk_front.visible = true;
				self.walk_back.visible = false;
				self.walk_front.scaleX = -1;		
			}
			if (state == 'walk_back_left') {
				self.idle.visible = false;
				self.walk_front.visible = false;
				self.walk_back.visible = true;		
				self.walk_back.scaleX = -1;
			}
		}
		
		hideEggs();
		
		this.setState = setState;
		this.showEggs = showEggs;
		this.hideEggs = hideEggs;
	}

(lib.Barndonkey = function(mode,startPosition,loop) {
	this.initialize(mode,startPosition,loop,{});

	// timeline functions:
	this.frame_0 = function() {
		var barn_progress = exportRoot.barn_progress;
		var clickArea = this.click_area;
		var farm = exportRoot.farm;
		var donkey_anim = this.donkey_anim;
		var isReady = true;
		var isFarmReady = false;
		var isManager = false;
		var currEggs = 0;
		var maxEggs = 24;
		var level = 1;
		
		farm.addEventListener('ready_to_delivery', function() {	
			isFarmReady = true;
			if (isManager) clickHandler();
		});
		
		clickArea.addEventListener('click', clickHandler);
		
		function clickHandler() {
			if (!isReady || !isFarmReady || donkey_anim.currentFrame != 0) return;
			donkey_anim.play();
			isReady = false;
			isFarmReady = false;
			currEggs = Math.min(farm.getEggs(), maxEggs);
		}
		
		this.addEventListener('ready', function() {
			isReady = true;
			if (isManager) clickHandler();
		})
		
		this.setManager = function() {
			isManager = true;
			clickHandler();
			this.dispatchEvent('set_manager');
		}
		
		this.getEggs = function() {
			return currEggs;
		}
		
		this.upgrade = function() {
			if (level >= 5) return;
			maxEggs *= 2;	
			barn_progress.gotoAndPlay(15*(level-1)+1);
			level++;	
		}
	}

	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(1));

	// donkey_anim
	this.donkey_anim = new lib.Donkeyanim();
	this.donkey_anim.name = "donkey_anim";

(lib.Farmmc = function(mode,startPosition,loop) {

		var currEggs = 24;
		var maxEggs = 24;
		var toDelivery = 0;
		var production_speed = 0.1;
		var isReady = false;
		var isManager = false;
		var level = 1;
		
		var farm = this;
		var barn = exportRoot.barn;
		var clickArea = this.click_area;
		var currEggsNum = exportRoot.farm_bubble_anim.bubble.curr;
		var maxEggsNum = exportRoot.farm_bubble_anim.bubble.max;
		var farmerAnim = this.farmer_anim;
		var farm_progress = exportRoot.farm_progress;
		
		this.stop();
		this.visible = true;
		this.hen1.gotoAndPlay(9);
		this.hen3.gotoAndPlay(5);
		
		currEggsNum.align = 'right';
		maxEggsNum.value = maxEggs;
		
		this.addEventListener('tick', function() {
			if (isReady) return;
			currEggs += production_speed;
			if (currEggs >= maxEggs) {
				isReady = true;		
				currEggs = maxEggs;
				toDelivery = maxEggs;
				if (isManager) clickHandler();
			}
			currEggsNum.value = parseInt(currEggs);
		});
		
		clickArea.addEventListener('click', clickHandler);
		
		function clickHandler() {
			if (!isReady || farmerAnim.currentFrame != 0) return;
			farmerAnim.play();
			currEggs = 0;
			isReady = false;
			farm.dispatchEvent('ready_to_delivery');
		}
		
		/*farmerAnim.addEventListener('go_anim_end', function() {
			farm.dispatchEvent('ready_to_delivery');
		})*/
		
		farmerAnim.addEventListener('return_anim_end', function() {
			if (isManager) clickHandler();
		})
		
		barn.addEventListener('loading_done', function() {	
			farmerAnim.play();
		})
		
		this.setManager = function() {
			isManager = true;
			clickHandler();
			this.dispatchEvent('set_manager');
		}
		
		this.getEggs = function() {
			return toDelivery;
		}
		
		this.upgrade = function() {

			maxEggs *= 2;
			production_speed *= 2;

				.call(function(e) {			
					moneyTxt.value += 100;

			achivment.play();

// bootstrap callback support:

(lib.Stage = function(canvas) {
	createjs.Stage.call(this, canvas);
}).prototype = p = new createjs.Stage();

p.setAutoPlay = function(autoPlay) {
	this.tickEnabled = autoPlay;
}
p.play = function() { this.tickEnabled = true; this.getChildAt(0).gotoAndPlay(this.getTimelinePosition()) }
p.stop = function(ms) { if(ms) this.seek(ms); this.tickEnabled = false; }
p.seek = function(ms) { this.tickEnabled = true; this.getChildAt(0).gotoAndStop(lib.properties.fps * ms / 1000); }
